import React from "react";
import web from "../src/images/4.JPG";
const Home=() =>{
    return(
        <>
            <section id="header" className="">
            <div className="container-fluid nav_bg">
            <div className="row">
                <div className="col-10 mx-auto">
                <div className="row">
                <div className="col-md-6  pt-5 pt-lg-0 order-2 order-lg-1">
                    <h1>Grow your business with  <strong className="text-info">Online Website</strong></h1>
                    <h3 className="my-3">we aer the team of talented developer making websites</h3>
                    <div className="mt-3">

                    <a className="btn btn-outline-primary btn-lg" href="">Get Started</a>
                    </div></div>
                    <div className="col-lg-6 order-1 order-lg-2 order-1 header-img">
                        <img className="img-fluid" src={web} alt="1"/>
                    </div>
                    </div>
                </div>
            </div>
        </div>


            </section>
        </>
    );


};
export default Home;
